CREATE VIEW SITATSA.V_IMPR_SOGGETTI(CODIMP, CODTIM, INCARICO, NOMTIM, CFTIM, DATINI, DATFIN, NOTLEG) AS 
SELECT CODIMP2 CODIMP, CODTIM, (CAST('Legale rappresentante' AS VARCHAR(100))) INCARICO, NOMTIM, CFTIM, LEGINI DATINI, LEGFIN DATFIN, NOTLEG 
FROM SITATSA.IMPLEG, SITATSA.TEIM 
WHERE CODTIM=CODLEG 
UNION 
SELECT CODIMP3 CODIMP, CODTIM, (CAST('Direttore tecnico' AS VARCHAR(100))) INCARICO, NOMTIM, CFTIM, DIRINI DATINI, DIRFIN DATFIN, NOTDTE 
FROM SITATSA.IMPDTE, SITATSA.TEIM 
WHERE CODTIM=CODDTE 
UNION 
SELECT CODIMP4 CODIMP, CODTIM, TAB1DESC INCARICO, NOMTIM, CFTIM, INIAZI DATINI, FINAZI DATFIN, NOTAZI 
FROM SITATSA.IMPAZI, SITATSA.TEIM, SITATSA.TAB1 
WHERE CODTIM=CODTEC AND TAB1COD LIKE 'Ag007' AND TAB1TIP=INCAZI 
UNION
SELECT CODIMP, CODTIM, TAB1DESC INCARICO, NOMTIM, CFTIM, INCINI DATINI, INCFIN DATFIN, NOTCOL 
FROM SITATSA.G_IMPCOL, SITATSA.TEIM, SITATSA.TAB1 
WHERE CODTIM=CODTEC AND TAB1COD LIKE 'G_039' AND TAB1TIP=INCTIP;


